return (
    <div className="MainPage">
     <div className="PostContainer">
       {postList.map((val,key)=>{
         return (
          <div className="Post" >
           <p>{val.email}</p>
           <p>{val.name}</p>
           <p>{val.password}</p>
           <p>{val.gender}</p>
           <p>{val.accountType}</p>
            </div>
           )  })}  
          </div>
        </div>
    )}

export default MainPage
